import * as React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import ProfileScreen from '../../screens/Profile';
import Test from '../../screens/Test';
import { MaterialCommunityIcons } from '@expo/vector-icons';
import { Feather } from '@expo/vector-icons';
import { FontAwesome5 } from '@expo/vector-icons';
import { Avatar,Button, Card, Title, Paragraph } from 'react-native-paper';
const Drawer = createDrawerNavigator();

export default function Header() {
    return (
      <NavigationContainer>
        <Drawer.Navigator>
          <Drawer.Screen name="Home" component={ProfileScreen} />
          <Drawer.Screen
           options={{drawerIcon: ({focused, size}) => (
              <Feather   name="home"   size={20} color="#e91e63" /> 
            ), }}
          name="Business" component={ProfileScreen} />

<Drawer.Screen
           options={{drawerIcon: ({focused, size}) => (
              <Feather   name="home"   size={20} color="#e91e63" /> 
            ), }}
          name="Membership" component={ProfileScreen} />


          <Drawer.Screen name="Membership" component={ProfileScreen} />
          <Drawer.Screen name="About" component={ProfileScreen} />
          <Drawer.Screen name="Contact" component={ProfileScreen} />
          <Drawer.Screen name="Test" component={Test} />
        </Drawer.Navigator>
      </NavigationContainer>
    );
  }
